-%E7%BB%BF%E7%BB%AE------------/" target="_blank">绿绮</a>&nbsp;<a href="/s/-%E5%BC%A0%E7%8F%88%E9%93%AD------------/" target="_blank">张珈铭</a>&nbsp;<a href="/s/-%E6%9D%A8%E5%8D%AB------------/" target="_blank">杨卫</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E9%A5%BA%E5%AD%90--------/" target="_blank">饺子</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/4/" target="_blank">动漫</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2019/" target="_blank">2019</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.08.28</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>天地灵气孕育出一颗能量巨大的混元珠，元始天尊将混元珠提炼成灵珠和魔丸，灵珠投胎为人，助周伐纣时可堪大用；而魔丸则会诞出魔王，为祸人间元始天尊启动了天劫咒语，3年后天雷将会降临，摧毁魔丸。太乙受命将灵珠托生于陈塘关李靖家的儿子哪吒身上。然而阴差阳错，灵珠和魔丸竟然被掉包。本应是灵珠英雄的哪吒却成了混世</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/95091/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/96786/" data-original="http://cj.subo8988.com:8988/upload/vod/2019-08-06/201908061565067170.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">5.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/96786/">哪吒之魔童降世-片尾曲《今后我与自己流浪》</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span>未知</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span>未知</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/22/" target="_blank">其他片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2019/" target="_blank">2019</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.08.06</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>暂无简介</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/96786/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/3977/" data-original="http://pic.iqiyi6123.com/upload/vod/2019-01-17/154771141817.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">3.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center"></span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/3977/">我是哪吒</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E9%99%B6%E5%85%B8------------/" target="_blank">陶典</a>&nbsp;<a href="/s/-%E9%9F%A9%E5%A8%87%E5%A8%87------------/" target="_blank">韩娇娇</a>&nbsp;<a href="/s/-%E5%88%98%E5%9E%9A------------/" target="_blank">刘垚</a>&nbsp;<a href="/s/-%E5%BD%AD%E5%8D%9A------------/" target="_blank">彭博</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E8%88%92%E5%B1%95--------/" target="_blank">舒展</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/22/" target="_blank">其他片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2016/" target="_blank">2016</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.08.03</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>殷商末年，东海大将夜叉密谋篡权，企图暗害龙王之女以达成他统治东海的目的不料其阴谋被陈塘关总兵李靖之子哪吒无意撞到。为了掩人耳目，夜叉将暗害龙女的罪名嫁祸给哪吒，将其变为龙族的公敌。而在另外一方，哪吒受怪仙太乙真人之命前往金光洞修道，途中遇到了遭遇夜叉暗害而失去记忆的龙女，以及精通变化和遁地之术的土行</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/3977/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/5267/" data-original="http://pic.iqiyi6123.com/upload/vod/2018-04-29/201804291524968996.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">9.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center"></span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/5267/">哪吒1983</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span>未知</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span>未知</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/22/" target="_blank">其他片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span>未知</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span>未知</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.28</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>殷商纣王无道。 东海恶龙乘机到人间作乱。太乙真人派弟子灵珠子下凡人间，降世为李靖之子，太乙真人授予法宝，并为其取名哪吒，命其为民除害。龙王寿辰，龙子到人间劫夺童子，哪吒将龙子打死。龙王来找李靖索子偿命，李靖怕伤及百姓，只好命哪吒交出法宝。龙王不许，水淹陈塘关，哪吒为大局着想，自刎以退凶龙。太乙真人心</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/5267/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/95332/" data-original="http://cj.subo8988.com:8988/upload/vod/2019-07-28/201907281564291661.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">7.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/95332/">哪吒闹海</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E6%A2%81%E6%AD%A3%E6%99%96------------/" target="_blank">梁正晖</a>&nbsp;<a href="/s/-%E9%82%B1%E5%B2%B3%E5%B3%B0------------/" target="_blank">邱岳峰</a>&nbsp;<a href="/s/-%E6%AF%95%E5%85%8B------------/" target="_blank">毕克</a>&nbsp;<a href="/s/-%E5%AF%8C%E6%B6%A6%E7%94%9F------------/" target="_blank">富润生</a>&nbsp;<a href="/s/-%E5%B0%9A%E5%8D%8E------------/" target="_blank">尚华</a>&nbsp;<a href="/s/-%E4%BA%8E%E9%BC%8E------------/" target="_blank">于鼎</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E4%B8%A5%E5%AE%9A%E5%AE%AA--------/" target="_blank">严定宪</a>&nbsp;<a href="/s/-----%E7%8E%8B%E6%A0%91%E5%BF%B1--------/" target="_blank">王树忱</a>&nbsp;<a href="/s/-----%E5%BE%90%E6%99%AF%E8%BE%BE--------/" target="_blank">徐景达</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/4/" target="_blank">动漫</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------1979/" target="_blank">1979</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.28</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>商末时期，陈塘关总兵李靖的夫人怀胎3年6个月，最终生下一个肉球，肉球中跳出一个伶俐可爱的男孩李靖原当他是妖孽欲杀之而后快，幸太乙真人前来收之为徒，赐名哪吒，并赐以乾坤圈和混天绫两件宝贝。某年，天下大旱，甘露未降。哪吒和家将到东海洗澡玩耍。他用混天绫搅动海水，撼动龙宫，惹出巡海夜叉李艮和龙王三太子敖丙</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/95332/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/53312/" data-original="http://cj.subo8988.com:8988/upload/vod/2018-12-25/201812251545706046.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">4.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">HD</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/53312/">哪吒</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E5%82%85%E5%A3%B0------------/" target="_blank">傅声</a>&nbsp;<a href="/s/-%E5%86%AF%E5%85%8B%E5%AE%89------------/" target="_blank">冯克安</a>&nbsp;<a href="/s/-%E6%9D%8E%E5%85%81%E4%B8%AD------------/" target="_blank">李允中</a>&nbsp;<a href="/s/-%E6%9B%BE%E5%BF%97%E4%BC%9F------------/" target="_blank">曾志伟</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E5%BC%A0%E5%BD%BB--------/" target="_blank">张彻</a>&nbsp;<a href="/s/-------------/" target="_blank"></a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/6/" target="_blank">动作片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E9%A6%99%E6%B8%AF-----------/" target="_blank">香港</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------1974/" target="_blank">1974</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.28</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>哪咤（傅声）生于三千多年前的商朝，父亲李靖（卢迪），是当时的总兵官，镇守陈塘关在纣王的统治下，人民饱受压迫，哪咤总是抱打不平而闯祸，因此令其父增添不少麻烦。父子最终水火不容，为救全家哪咤不惜削骨还父削肉还母。然而，哪咤却为一位神仙太乙真人（李允中）以莲花令其复活，并赐给他两件宝物，去解救受苦的百姓。</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/53312/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/54178/" data-original="http://pic.youku778.com/upload/vod/2019-05-15/201905151557881954.png"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">1.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">1080P</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/54178/">新封神之哪吒闹海</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-------------/" target="_blank"></a>&nbsp;<a href="/s/-%E8%B0%A2%E8%8B%97------------/" target="_blank">谢苗</a>&nbsp;<a href="/s/-%E9%92%B1%E5%B0%8F%E8%B1%AA------------/" target="_blank">钱小豪</a>&nbsp;<a href="/s/-%E9%98%9A%E6%98%95------------/" target="_blank">阚昕</a>&nbsp;<a href="/s/-%E6%9D%8E%E5%85%88%E6%97%B6------------/" target="_blank">李先时</a>&nbsp;<a href="/s/-%E8%8C%83%E5%AD%90%E7%BB%AE------------/" target="_blank">范子绮</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-------------/" target="_blank"></a>&nbsp;<a href="/s/-----%E7%BD%97%E4%B9%90--------/" target="_blank">罗乐</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/6/" target="_blank">动作片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%A4%A7%E9%99%86-----------/" target="_blank">大陆</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2019/" target="_blank">2019</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>　商纣时代人间妖魔作祟，黎民饱受其苦。蛇妖石矶欲掳走总兵李靖幼子，未果，被李靖重伤后遁走，石矶暗恨。十八年后哪吒成人，习得降妖本事，却因李靖中石矶挑拨之计，被迫自刎。后经太乙真人点化，转世重生。</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/54178/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/66065/" data-original="https://img.tupian-zuida.com/pic/upload/vod/2019-05-12/201905121557640649.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">1.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">BD高清</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/66065/">电哪吒</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E8%93%9D%E6%AD%A3%E9%BE%99------------/" target="_blank">蓝正龙</a>&nbsp;<a href="/s/-%E8%B0%A2%E6%AC%A3%E9%A2%96------------/" target="_blank">谢欣颖</a>&nbsp;<a href="/s/-%E5%A4%AA%E4%BF%9D------------/" target="_blank">太保</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%E6%9D%8E%E8%BF%90%E6%9D%B0--------/" target="_blank">李运杰</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">分类：</span><a href="/vodtype/11/" target="_blank">剧情片</a></li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">地区：</span><a href="/s/--%E5%8F%B0%E6%B9%BE-----------/" target="_blank">台湾</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">年份：</span><a href="/s/-------------2011/" target="_blank">2011</a>&nbsp;</li><li class="fed-col-xs6 fed-col-md3 fed-part-eone"><span class="fed-text-muted">更新：</span>2019.07.13</li><li class="fed-col-xs12 fed-hide fed-show-md-block"><div class="fed-part-esan"><span class="fed-text-muted">简介：</span>蓝正龙画脸谱杀气腾腾 该片最初剧本设定为“纵横黑白两道的大哥，和游移在庙会当八家将与在趴场当电音打碟的儿子，爆发出仿佛是李靖与哪吒的父子对立爱恨情结…”</div></li></ul></dd><dd class="fed-deta-button fed-col-xs7 fed-col-sm8 fed-part-rows"><a class="fed-deta-play fed-rims-info fed-btns-info fed-btns-green fed-col-xs4" href="/d/66065/">查看详情</a></dd></dl><dl class="fed-deta-info fed-deta-padding fed-line-top fed-margin fed-part-rows fed-part-over"><dt class="fed-deta-images fed-list-info fed-col-xs3"><a class="fed-list-pics fed-lazy fed-part-2by3" href="/d/52313/" data-original="http://pic.iqiyi6123.com/upload/vod/2019-01-17/15477327639.jpg"><span class="fed-list-play fed-hide-xs"></span><span class="fed-list-score fed-font-xii fed-back-green">4.0</span><span class="fed-list-remarks fed-font-xii fed-text-white fed-text-center">BD高清</span></a></dt><dd class="fed-deta-content fed-col-xs7 fed-col-sm8 fed-col-md10"><h1 class="fed-part-eone fed-font-xvi"><a href="/d/52313/">少女哪吒</a></h1><ul class="fed-part-rows"><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">主演：</span><a href="/s/-%E6%9D%8E%E5%98%89%E7%90%AA------------/" target="_blank">李嘉琪</a>&nbsp;<a href="/s/-%E6%9D%8E%E6%B5%A9%E8%8F%B2------------/" target="_blank">李浩菲</a>&nbsp;<a href="/s/-%E9%99%88%E7%91%BE------------/" target="_blank">陈瑾</a>&nbsp;<a href="/s/-%E8%BE%9B%E9%B9%8F------------/" target="_blank">辛鹏</a>&nbsp;</li><li class="fed-col-xs12 fed-col-md6 fed-part-eone"><span class="fed-text-muted">导演：</span><a href="/s/-----%